                { "currency", code },
            };
        }
        object toAddress = this.safeString(transaction, "toAddress");
        return new Dictionary<string, object>() {
            { "info", transaction },
            { "id", this.safeString2(transaction, "id", "withdrawId") },
            { "txid", this.safeString(transaction, "txID") },
