                { "maintenanceMarginRate", this.safeNumber(item, "maintenanceMargin") },
                { "maxLeverage", this.safeNumber(item, "maxLeverage") },
                { "info", item },
            });
            minNotional = maxNotional;
        }
        return tiers;
    }

